=head1 DESCRIPTION

Information about a repository sync attempt for a repository with a
sync configuration.

=head1 ATTRIBUTES


=head2 B<REQUIRED> Events => ArrayRef[L<Paws::CodeConnections::RepositorySyncEvent>]

The events associated with a specific sync attempt.


=head2 B<REQUIRED> StartedAt => Str

The start time of a specific sync attempt.


=head2 B<REQUIRED> Status => Str

The status of a specific sync attempt. The following are valid
statuses:

=over

=item *

INITIATED - A repository sync attempt has been created and will begin
soon.

=item *

IN_PROGRESS - A repository sync attempt has started and work is being
done to reconcile the branch.

=item *

SUCCEEDED - The repository sync attempt has completed successfully.

=item *

FAILED - The repository sync attempt has failed.

=item *

QUEUED - The repository sync attempt didn't execute and was queued.

=back




